import { gql } from '@apollo/client';

const AuthHelper = {
    login: gql(`
                    query login($username: String!, $password: String!) {
                        login(username: $username, password: $password){
                            response_type,
                            response,
                            username,
                            accessToken
                        }
                    }
                `)
}

export default AuthHelper;
